import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import { faGoogle } from '@fortawesome/free-brands-svg-icons';

import React from 'react';

const Google = () => (
	<FontAwesomeIcon style={{ margin: '1rem' }} icon={faGoogle} size='2x' />
);

export { Google };
